import React from 'react';
import './BigCard.css';

export function BigCard(props){
    return (
        <div className="container">
            <img src={ props.imagem } alt=""/>
            <div className="texto">
                <h4>{ props.titulo }</h4>
                <p> { props.texto } </p>
            </div>
        </div>
    )
}
